import { Box, Paper } from "@mui/material";
import React from "react";
import ProfileAEdata from "../fragments/ProfileIconData";
import ProfileData from "../fragments/ProfileData";

const Profile = () => {
  return (
    <Box>
      <Paper component="section">
        <ProfileAEdata />
        <ProfileData />
      </Paper>
    </Box>
  );
};

export default Profile;
